/*Table structure for table `sl_attr` */

DROP TABLE IF EXISTS `sl_attr`;

CREATE TABLE `sl_attr` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '属性名',
  `value` varchar(256) NOT NULL COMMENT '属性值',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0文本框 1多选项 2单选项',
  `is_common` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0非公共属性， 1为公共属性',
  `is_search` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0非搜索条件， 1为搜索条件。当type=0时，默认为0',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态，0禁用 1可用',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='城市表';

