  `pay_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '默认值0 （0：未支付，1支付成功，2：支付失败，3支付超时）',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '订单状态。默认值0（0：未使用，1：已使用，2：已取消）',
  `verify_code` varchar(16) NOT NULL COMMENT '券码',
  `gym_id` int(11) NOT NULL COMMENT '场馆ID',
  `pro_id` int(11) NOT NULL DEFAULT '0' COMMENT '项目ID',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_no` (`order_no`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='订单表';

