/*Table structure for table `sl_order_item` */

DROP TABLE IF EXISTS `sl_order_item`;

CREATE TABLE `sl_order_item` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '下单用户ID',
