/*Table structure for table `sl_project` */

DROP TABLE IF EXISTS `sl_project`;

CREATE TABLE `sl_project` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '城市名称',
  `number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '比如足球项目默认售出次数为2',
  `attr_ids` varchar(128) NOT NULL DEFAULT '' COMMENT '属性ID，多个以,号分隔',
  `tag_name` varchar(16) NOT NULL COMMENT '缩写(例如：羽毛球 ym)',
  `idx` int(11) NOT NULL COMMENT '排序',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '状态，0禁用 1可用',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='城市表';

