/*Table structure for table `sl_site` */

DROP TABLE IF EXISTS `sl_site`;

CREATE TABLE `sl_site` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `gym_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '  场馆ID',
  `pro_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '项目ID',
  `site_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '场地名称ID',
  `date` date NOT NULL DEFAULT '0000-00-00' COMMENT '日期',
  `begin_time` time NOT NULL DEFAULT '00:00:00' COMMENT '开始时间',
  `end_time` time NOT NULL DEFAULT '00:00:00' COMMENT '结束时间',
  `price` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '价格*100',
  `saled_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '已预订次数',
  `is_onetime` tinyint(1) unsigned NOT NULL DEFAULT '2' COMMENT '1则一次性数据 2则每周这一日有效数据  3则从当日起之后的一周有效。',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '状态 0禁用 1可用',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2597 DEFAULT CHARSET=utf8 COMMENT='场次表';

