/*Table structure for table `sl_site_name` */

DROP TABLE IF EXISTS `sl_site_name`;

CREATE TABLE `sl_site_name` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `gym_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '场馆ID',
  `pro_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '项目ID',
  `name` varchar(16) NOT NULL DEFAULT '' COMMENT '场地名,最长不超过5个字符，场次名将短信发给用户',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否启用，1启用 0 不启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='场次名表';

