/*Table structure for table `sl_sms` */

DROP TABLE IF EXISTS `sl_sms`;

CREATE TABLE `sl_sms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '注册验证码',
  `mobile` varchar(16) NOT NULL DEFAULT '' COMMENT '接收手机号码',
  `verify_code` varchar(8) NOT NULL DEFAULT '' COMMENT '验证码，默认6位',
  `content` text NOT NULL COMMENT '短信内容',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态， 1未使用 0已使用',
  `create_time` int(11) NOT NULL COMMENT '发送时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

