/*Table structure for table `sl_user` */

DROP TABLE IF EXISTS `sl_user`;

CREATE TABLE `sl_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `realname` varchar(32) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `username` varchar(32) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '密码，两次md5',
  `mobile` varchar(16) NOT NULL DEFAULT '0' COMMENT '手机号，可用于登录',
  `email` varchar(64) NOT NULL DEFAULT '' COMMENT 'emal，可用于登录',
  `origin` tinyint(2) NOT NULL DEFAULT '1' COMMENT '来源，0朋友介绍；1微信',
  `client` tinyint(2) NOT NULL DEFAULT '1' COMMENT '注册平台，0移动端 1PC端',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态，1可用 0禁用',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `login_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后登录时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

